INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (209,'Eclipse  ',100,8500,'La iluminación del arte en museos y salas de exposiciones, así como la de proyectos en el sector del retail de lujo, requieren herramientas de iluminación de gama alta. Eclipse ofrece una tecnología innovadora, el máximo confort visual y un amplio sistema que proporciona una flexibilidad sin igual para soluciones de iluminación personalizadas. ',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (210,'Parscan',100,7500,'Luz en lugar de luces: la sencilla forma básica cilíndrica de Parscan obedece a esta idea directriz. La luminotecnia precisa y flexible permite implementar eficientemente diversas soluciones de iluminación. \r\nSi se orienta el proyector hacia abajo como si se tratara de un Downlight, el brazo de soporte se integra perfectamente en la forma global.',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (211,'Optec',50,5000,'Todo es posible con Optec. Con sus diversas distribuciones luminosas, Optec satisface todos los requisitos de la iluminación en tiendas, galerías y museos: acentuaciones contrastadas, bañado de objetos expuestos, iluminación uniforme de paredes o conos de luz de contornos nítidos para crear efectos de iluminación expresivos. Gracias a su luminotecnia innovadora, Optec aúna eficiencia y confort visual',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (212,'Opton',75,4500,'Gracias a su altura constructiva sumamente reducida y a su elevada potencia luminosa, Opton es ideal para escaparates o locales de venta.\r\nEl cabezal de fundición de aluminio garantiza una larga duración gracias a su gestión térmica perfeccionada.\r\nEn combinación con una luminotecnia eficiente, Opton ofrece unas condiciones ideales en cuanto a eficiencia energética, y alcanza un grado máximo de rentabilidad.',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (213,'Light Board',60,7000,'Light Board se caracteriza por su diseño llamativo. El cuerpo plano integra el equipo auxiliar y, gracias a su gestión térmica perfeccionada, garantiza una larga duración. En virtud de su luminotecnia innovadora y de su facilidad de ajuste, Light Board convence incluso en tareas exigentes en locales comerciales y museos. ',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (214,'Logotec',55,4500,'Los contrastes de luminosidad dirigen la mirada del cliente y realzan el atractivo de los distintos productos en las tiendas. Este es el dominio de Logotec. Es aquí donde convencen su diseño de sistema y su eficiencia energética.\r\nEste proyector montado de forma flexible en raíles electrificados acentúa eficientemente ropa, joyas o alimentos',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (215,'Oseris',30,6500,'Con Oseris hace su entrada en el mundo de la iluminación digital una genial idea de diseño: la articulación giratoria, que se integra perfectamente como sección oblicua en el cabezal hemisférico. Una solución que no solo es estéticamente atractiva, sino que además permite una orientación sumamente precisa y ofrece un valor añadido en situaciones con poca libertad de movimiento, por ejemplo en canales de techo.',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (216,'Pollux',65,5000,'Pollux fue desarrollado para el uso versátil. Gracias a su formato compacto, despliega sus virtudes especialmente en museos, en el comercio minorista, en la restauración o en el entorno doméstico privado.',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (217,'Stella',10,15000,'Herramientas potentes, eficientes y precisas para la iluminación de acento\r\nEs una ley física: la iluminancia disminuye de forma proporcional al cuadrado de la distancia entre la fuente de luz y la superficie iluminada. Por tanto, se necesitan luminarias potentes para grandes distancias de iluminación y espacios con techos altos: por ejemplo, para la escenificación de vehículos en un pabellón ferial, para grandes esculturas en el vestíbulo de un museo o para el bañado de paredes uniforme en un aeropuerto',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (218,'Skim Downlight',35,4500,'Rentabilidad, eficiencia y confort luminoso para los entornos laborales dinámicos actuales Las luminarias Skim para raíles electrificados, con su doble óptica de lentes en un cuerpo plano de fundición de aluminio, no solo poseen un diseño extraordinario, sino que al mismo tiempo definen una categoría de herramientas de iluminación: aúna la flexibilidad de los proyectores para el raíl electrificado con el confort visual, la eficiencia y la simplicidad de los downlights',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (219,'Jilly para riel',25,5000,'Iluminación de puestos de trabajo de oficina altamente eficiente y conforme a la normativa, con el raíl electrificado como base flexible.\r\nLas luminarias Jilly para raíles electrificados se encargan de la iluminación eficiente de puestos de trabajo conforme a la normativa y son idóneas para el entorno laboral moderno y dinámico, en el que las distribuciones de oficinas cambian y se reorganizan continuamente. El cuerpo especialmente plano y una llamativa rejilla de lamas marcan su elegante estética ',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (220,'Compar para Riel',30,4500,'La combinación de raíles electrificados como infraestructura y luminarias Compar permite iluminar la arquitectura de oficinas y los puestos de trabajo de manera diferenciada, ergonómica y al mismo tiempo extremadamente flexible. Se utiliza la luminotecnia de la amplia familia Compar también en su versión de downlights para railes electrificados. Con su cuerpo plano, también están indicados para espacios con una escasa altura del techo',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (221,'Palco ',40,3000,'Luminaria de interiores orientable y con adaptador para instalación sobre raíl de tensión de red.\r\nLuminaria realizada en aluminio fundido a presión.\r\nLa doble orientabilidad de la luminaria permite una rotación de 360° alrededor del eje vertical y una inclinación de 90° respecto al plano horizontal.\r\nBloqueos mecánicos del direccionamiento tanto para la rotación alrededor del eje vertical como respecto al plano horizontal.',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (222,'Le Perroquet',70,12000,'Cuerpo óptico en aluminio fundición a presión y material termoplástico. Elevado confort visual.',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (223,'Tesis',40,15000,'Un arquetipo innovador en la iluminación de espacios exteriores Tesis, desde hace tiempo un elemento integral del programa de exteriores, ha alcanzado un nuevo nivel de rendimiento fruto de un desarrollo intensivo. La luminotecnia convence con un grado máximo de brillo y eficiencia. Ya sea en la variante redonda o cuadrada, el nuevo diseño del cuerpo, sensiblemente más plano gracias a la tecnología LED, posibilita un montaje sumamente cómodo',8);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (224,'Site Bañador',20,20000,'Bañadores de pared de luz rasante para acentuar texturas\r\nen muros y fachadas Site acentúa la textura de los materiales de la arquitectura: el bañador de pared de luz tenue hace claramente visibles incluso las texturas más sutiles de la madera, el hormigón o los ladrillos y de superficies rugosas como piedra natural, lo que hace posible la acentuación\r\nexpresiva de elementos históricos o materiales regionales.',8);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (225,'Tesis Cuadrado',20,18000,'Un arquetipo innovador en la iluminación de espacios exteriores Tesis, desde hace tiempo un elemento integral del programa de exteriores, ha alcanzado un nuevo nivel de rendimiento fruto de un desarrollo intensivo. La luminotecnia convence con un grado máximo de brillo y eficiencia. Ya sea en la variante redonda o cuadrada, el nuevo diseño del cuerpo, sensiblemente más plano gracias a la tecnología LED, posibilita un montaje sumamente cómodo ',8);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (226,'Midipoll baliza',25,10000,'La suave luz rasante sobre el marcado perfil en forma de cruz convierte a Midipoll en un elemento estructurador del espacio Con Midipoll se presenta una baliza que responde al concepto del confort visual eficiente. La innovadora luminotecnia con una lente prismática especial proyecta eficazmente el flujo luminoso sobre la superficie de destino, sin deslumbramiento, para cumplir los requisitos Dark Sky. De este modo, el cielo nocturno permanece oscuro y las estrellas visibles.',8);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (227,'Castor baliza',20,18000,'La baliza Castor crea en espacios exteriores un vínculo visual entre trayectos y plazas: dos distribuciones luminosas y tres tamaños permiten un diseño de iluminación diferenciado empleando una sola familia de luminarias. Por medio de una lente anular, un innovador sistema óptico genera alternativamente una distribución luminosa con un ángulo de irradiación de 180° dirigida hacia un lado para la iluminación de trayectos o una distribución luminosa de 360° para superficies libres',8);
